import React from "react";
import {
  PieChart,
  Pie,
  Cell,
  Tooltip,
  Legend,
  ResponsiveContainer,
  BarChart,
  Bar,
  XAxis,
  YAxis,
  CartesianGrid,
  LineChart,
  Line,
} from "recharts";

function Dashboard({ devices = [] }) {
  const totalDevices = devices.length;
  const totalPower = devices.reduce((sum, d) => sum + Number(d.kWh || 0), 0);

  const onCount = devices.filter((d) => d.STATUS === "On").length;
  const offCount = devices.filter((d) => d.STATUS === "Off").length;

  const pieData = [
    { name: "On", value: onCount },
    { name: "Off", value: offCount },
  ];

  const barData = devices.map((d) => ({
    name: d.DEVICE_NAME,
    Power: Number(d.kWh || 0),
  }));

  const lineData = devices.map((d, index) => ({
    name: d.DEVICE_NAME,
    Power: Number(d.kWh || 0),
    idx: index + 1,
  }));

  const COLORS = ["#4caf50", "#f44336"];

  return (
    <div style={{ display: "flex", flexDirection: "column", gap: "24px" }}>
      <div
        style={{
          padding: "16px",
          border: "1px solid #ccc",
          borderRadius: "8px",
        }}
      >
        <h2>Dashboard</h2>
        <p>Tổng thiết bị: {totalDevices}</p>
        <p>Tổng POWER: {totalPower} W</p>
      </div>

      <div style={{ display: "flex", gap: "24px", flexWrap: "wrap" }}>
        {/* Pie Chart */}
        <div
          style={{
            flex: 1,
            minWidth: "300px",
            height: "300px",
            border: "1px solid #ccc",
            borderRadius: "8px",
            padding: "16px",
          }}
        >
          <h3>Trạng thái thiết bị</h3>
          <ResponsiveContainer width="100%" height="100%">
            <PieChart>
              <Pie
                data={pieData}
                dataKey="value"
                nameKey="name"
                cx="50%"
                cy="50%"
                outerRadius={80}
                label
              >
                {pieData.map((entry, index) => (
                  <Cell
                    key={`cell-${index}`}
                    fill={COLORS[index % COLORS.length]}
                  />
                ))}
              </Pie>
              <Tooltip />
              <Legend />
            </PieChart>
          </ResponsiveContainer>
        </div>

        {/* Bar Chart */}
        <div
          style={{
            flex: 1,
            minWidth: "300px",
            height: "300px",
            border: "1px solid #ccc",
            borderRadius: "8px",
            padding: "16px",
          }}
        >
          <h3>Power thiết bị (Bar)</h3>
          <ResponsiveContainer width="100%" height="100%">
            <BarChart data={barData}>
              <CartesianGrid strokeDasharray="3 3" />
              <XAxis dataKey="name" />
              <YAxis />
              <Tooltip />
              <Legend />
              <Bar dataKey="Power" fill="#8884d8" />
            </BarChart>
          </ResponsiveContainer>
        </div>

        {/* Line Chart */}
        <div
          style={{
            flex: 1,
            minWidth: "300px",
            height: "300px",
            border: "1px solid #ccc",
            borderRadius: "8px",
            padding: "16px",
          }}
        >
          <h3>Power thiết bị (Line)</h3>
          <ResponsiveContainer width="100%" height="100%">
            <LineChart data={lineData}>
              <CartesianGrid strokeDasharray="3 3" />
              <XAxis dataKey="name" />
              <YAxis />
              <Tooltip />
              <Legend />
              <Line
                type="monotone"
                dataKey="Power"
                stroke="#82ca9d"
                strokeWidth={2}
              />
            </LineChart>
          </ResponsiveContainer>
        </div>
      </div>
    </div>
  );
}

export default Dashboard;
